import logo from './logo.svg';
import './App.css';

import mailLogo from './images/mail-svg.svg';

function App() {
  return (
    <div className="App">

      {/* Navbar */}
      <div className="navbar">
        <div className="navbar-left">
          <div className="logo">Dre</div>
          <ul>
            <li>What I Do</li>
            <li>Projetcs</li>
            <li>About Me</li>
          </ul>
        </div>
        <div className="navbar-right">
          <ul>
            <li><img src="./images/mail-svg.svg" alt="mail-logo"></img></li>
          </ul>
        </div>
      </div>

      {/* Landing Page */}
      <div className="landingPage">
        <div className="user-first-shadow">User First</div>
        <div className="slogan">User First Web Application to fit Your Needs.</div>
      </div>



    </div>
  );
}

export default App;
